import React from "react";
import { Carousel } from "react-bootstrap";

function AppCarousel() {
  return (
    <Carousel>
      <Carousel.Item>
        <img
          className="d-block w-100"
          src="/public/76.jpeg"
          alt="First slide"
        />
        </Carousel.Item>

    </Carousel>
  );
}

export default AppCarousel;
